import React from 'react';
import ReactDOM from 'react-dom';

const AppHeader = () => <Todo List />;

const SearchPanel = () => <input placeholder='search' />;

const TodoList = () => {
  return (<ul>
    <li>Learn React</li>
    <li>Build awesome App</li>
  </ul>);
}

const el = (
  <div>
    <AppHeader />
    <SearchPanel />
    <TodoList />
  </div>
);
ReactDOM.render(el,
  document.getElementById('root'));
